import React from 'react'
import { Col } from 'react-bootstrap';

function EventCards(props) {
    
  return (
    <div>
        <Col>  
            <h1>{props.title}</h1>
            <img src={props.imgLink}></img>
        </Col>
    </div>
  )
}

export default EventCards;
